column8:
　筋肉をキープしたまま、減量したい方に！<br><br>大豆プロテイン+ガルシニアエキス配合<br>たんぱく原料として、引き締まったカラダづくりをサポートする「大豆プロテイン」を配合。<br>運動で、減量したい方のカラダづくりに役立ちます。さらに「ガルシニアエキス」を配合しました。<br>減量時に消耗しやすく、カラダづくりに欠かせない「11種類のビタミン」と汗で失われがちなカルシウム・鉄・マグネシウムを配合しています。ヨーグルト風味。<br>「ザバス ウエイトダウン」は、1日2回(約42g)を目安にお召し上がりいただくことで、アスリートが1日に必要とする11種類のビタミン、3種類のミネラルの不足分を補えるよう設計されています。<br>(ザバス スポーツ&ニュートリション・ラボが実施したアスリートの食事調査結果より)<br><br>【おすすめの摂取方法】<br>牛乳または水300mlに付属のスプーン3杯(約21g)を溶かしてお召し上がりください。<br>食事にプラス、運動後がおすすめです。<br>※量は、お好みに応じて調整してください。<br>※牛乳または水に溶かした後は速やかにお飲みください。<br><br>●プロテインシェーカー(別売り)を使用すると溶けやすく手軽にプロテインを摂取できます。<br>●牛乳や水にオレンジ、バナナなどを入れミキサーで混ぜることで、プロテインフルーツドリンクとしてもおいしく飲めます。<br>●本製品にもカロリーはありますので、食事内容を見直し、計画的な栄養管理と運動を実践しなければ、目標を達成することは困難です。<br><br>【原材料】<br>脱脂大豆たんぱく、デキストリン、食塩、ガルシニアエキス、植物油脂、貝Ca、V.C、酸化Mg、香料、乳化剤、甘味料(アスパルテーム・L-フェニルアラニン化合物、スクラロース、アセスルファムK)、ピロリン酸第二鉄、ナイアシン、V.E、V.B2、V.B1、V.B6、パントテン酸Ca、V.A、葉酸、 V.D、V.B12<br><br>【栄養成分表示】<br>1食分(21g)当たり<br>エネルギー・・・79kcal<br>ビタミンE・・・1.5mg<br>たんぱく質・・・16.8g<br>ビタミンB1・・・0.87mg<br>脂質・・・0.9g<br>ビタミンB2・・・0.93mg<br>炭水化物・・・0.9g<br>ナイアシン・・・5.8mg<br>ナトリウム・・・93～220mg<br>ビタミンB6・・・0.64mg<br>カルシウム・・・192mg<br>葉酸・・・96μg<br>鉄・・・4.8mg<br>ビタミンB12・・・0.2μg<br>マグネシウム・・・96mg<br>パントテン酸・・・0.62mg<br>ビタミンA・・・157μg<br>ビタミンC・・・88mg<br>ビタミンD・・・2.2μg<br><br>●タンパク含量 84.5%(製品無水物あたり)<br>●ガルシニアエキス116mg/1食分(21g)あたり<br><br>商品区分:健康食品:スポーツ関連<br>広告文責:株式会社ワンステップ 0570-550860<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：明治<br>シリーズ名：ザバス<br>内容量：336g<br><br>購入単位：1個<br>配送種別：在庫品</p></td></tr></table><br><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>楽天 通販  QE1027 4902777323664 明治 メイジ めいじ ザバス ざばす サバス さばす プロテイン ぷろていん ダイエット だいえっと カラダ 体 からだ 吸収 きゅうしゅう 筋肉 きんにく すぽーつ スポーツ とれーにんぐ トレーニング 運動 うんどう よーぐると ヨーグルト よーぐる ヨーグル ウェイトダウン ウエイトダウン うえいとだうん うぇいとだうん ウェイト うえいと 減量 げんりょう 減らす へらす 体重 たいじゅう 減る へる</font></td></tr></table><br><style type="text/css">
